import React from 'react';
import Button from '../UI/Button';
import './CraneInfo.css';
import Ton8 from '../resources/images/8Ton.jpg';

const CraneInfo = () => {
    <React.Fragment>
        <Navbar btnText="Logout" className="btn-login"/>
        <div>
            <image src={Ton8}/>
            <hr/>
            <h3>Escorts 8 Ton Hydraulic crane</h3>
            <p>This crane is used to perform light load shifting ranging from 0-6 Ton capacity</p>
            <span><b>Price</b><b>500INR/Hr</b></span>
            <Button btnText="BookNow" className="btn-login"></Button>
        </div>
    </React.Fragment>
}

export default CraneInfo;
